let bigAdd l1 l2 = 
  let add (l1, l2) = 
    let f a x = 
      let (lh1, lh2) = x in
      let (carry, res) = a in
      let num = lh1 + lh2 + carry in
        ((num / 10), (num mod 10)::res) in
    let base = (0,[]) in
    let args = List.rev (List.combine (0::l1) (0::l2)) in
    let (_, res) = List.fold_left f base args in
      res
  in 
    removeZero (add (padZero l1 l2))

