let rec clone x n = 
  if n <= 0 then []
  else List.append [x] (clone x (n-1))
;;
let _ = clone 3 5;;
let _ = clone "foo" 2;; 
let _ = clone clone (-3);;


let padZero l1 l2 = 
  let x = List.length l1 in
  let y = List.length l2 in
    if x > y then (l1, List.append (clone 0 (x-y)) l2)
    else if x < y then (List.append (clone 0 (y-x)) l1, l2)
    else (l1, l2)
;;
let _ = padZero [9;9] [1;0;0;2];;
let _ = padZero [1;0;0;2] [9;9];;

let rec removeZero l = match l with
  | [] -> []
  | h :: t -> if h = 0 then removeZero t else l
;;

let _ = removeZero [0;0;0;1;0;0;2];;
let _ = removeZero [9;9];;
let _ = removeZero [0;0;0;0];;

let bigAdd l1 l2 = 
  let add (l1, l2) = 
    let f a x = 
      let (lh1, lh2) = x in
      let (carry, res) = a in
      let num = lh1 + lh2 + carry in
        ((num / 10), (num mod 10)::res) in
    let base = (0,[]) in
    let args = List.rev (List.combine (0::l1) (0::l2)) in
    let (_, res) = List.fold_left f base args in
      res
  in 
    removeZero (add (padZero l1 l2))
;;

let _ = bigAdd [9;9] [1;0;0;2];;
let _ = bigAdd [9;9;9;9] [9;9;9];; 


let rec mulByDigit i l = 
  if i <= 0 then []
  else bigAdd l (mulByDigit (i-1) l)
;;
let _ = mulByDigit 9 [9;9;9;9];;

let bigMul l1 l2 = 
  let f a x = 
    let (place, res) = a in
    let result = (mulByDigit x (List.append l1 (clone 0 place))) in
      (place+1,bigAdd res result) in
  let base = (0, []) in
  let args = List.rev (0::l2) in
  let (_, res) = List.fold_left f base args in
    res
;;
let _ = bigMul [9;9;9;9] [9;9;9;9];;
let _ = bigMul [9;9;9;9;9] [9;9;9;9;9];;


